script: |
  super -f text -I q9326.spq | sort > q9326.out

inputs:
  - name: q9326.spq
    data: |
      SELECT - CAST ( - col0 AS INTEGER ) + + + col1, + 83 / + col1 * - + col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( NULL ) > + 31 + + col1;
  - name: tab1

outputs:
  - name: q9326.out
    data: |
